import React from "react";
import { getAttendanceRateByDate } from "features/singleMeetingAnalysis/SingleMeetingAnalysisUtils";
import { AttendeeData } from "features/singleMeetingAnalysis/SingleMeetupTypes";

type Props = {
  attendees: AttendeeData[];
  eventDate: string;
};
const AttendanceBySignupDate = ({ attendees, eventDate }: Props) => {
  const attendanceRateByDate = getAttendanceRateByDate(attendees, eventDate);
  console.log("attendanceRateByDate", attendanceRateByDate);
  return <h3>Attendance By Signup Date</h3>;
};

export default AttendanceBySignupDate;
